import React from 'react';
import { Grid, AppBar, Tabs, Tab,  Box, Button } from '@material-ui/core'
// import "./App.css";

class App extends React.Component {
  render() {
    return (
      <Grid container className="App" direction="row" alignItems="stretch">
        <AppBar position="static">
          <Tabs aria-label="simple tabs example">
            <Tab label="Item One" />
            <Tab label="Item Two" />
            <Tab label="Item Three" />
          </Tabs>
          <TabPanel index={0}>
            Item One
          </TabPanel>
        </AppBar>
        <Box component="span" m={12}>
          <Button color="primary">Press me</Button>
        </Box>
      </Grid>
    );
  }
}

export default App;
